style.css:
@-moz-document domain("webtag.io") {
:root {
        --background: #000;
        --background-light: #525252;
        --text: #e2e2e2;
        --text-light: #909090;
        --red: #85261d;
        --green: #1d7d45;
        --blue: #225fa5;
    }
    button {
        color: var(--text);
        background-color: var(--blue);
        transition: background-color 0.3s ease;
    }

    button:hover {
        background-color: var(--background-light);
    }

    button:active {
        background-color: var(--red);
    }
    .switch .slider:before {
        background-color: var(--blue);
    }
}
